(1421, '20190832', '2016-04-18 16:24:13', '0000-00-00 00:00:00', '0000-00-00', '2016-04-28 16:09:00', 86054, 95524, 'Ricardo ', 'Sanchez', 'KIMWOOD SPA', 'PAGADA', 'TARJETA DE CREDITO EN LA OFICINA', '6051660056596', NULL, 'conpcion- santiago', 'CLP', 69000.00, 7132.00, 0.00, 'Los pasajeros podrán acceder al plan de protección de SKY a través de nuestra página web, contact center, oficinas comerciales y agencias de viajes.\n \nCambio en fecha de vuelo: \nPara solicitar cambio de fecha de vuelo deberá completar el formulario especialmente dispuesto en www.skyairline.com. También se podrá realizar este trámite en nuestras oficinas comerciales a lo largo de Chile.\n \nTodos los pasajeros con vuelos afectados por la movilización y que deseen postergar su fecha de vuelo, tienen hasta 10 días para fijar una nueva fecha de viaje, sujeto a la disponibilidad de la cabina sin penalidades ni diferencias tarifarias para finalizar el viaje hasta el 07 de julio 2016.\n \nDevolución de dinero: \nPara solicitar reembolso deberá completar el formulario especialmente dispuesto en www.skyairline.com. También se podrá realizar este trámite en nuestras oficinas comerciales a lo largo de todo Chile.\n \nLos pasajeros pueden solicitar el reembolso del 100% del boleto hasta 10 días después de la fecha original de su vuelo. Para boletos parcialmente utilizados se devolverá el monto de los tramos no volados.\n', 13538, '2016-04-28 16:09:00', 'E-3042', 75311.00, '2016-09-01 10:19:00', 'DEPOSITADO A LA CUENTA CORRIENTE DEL CLIENTE 6316968-4 SANTANDER', 'CLIENTE', 'S/N', NULL, 76132.00, '', NULL, NULL, 'Pasajero no viejo por huelga de Sky Airlines. Por esto se solicitad devolución total del pasaje. Devolver el monto a empresa  KIMWOOD SPA.', '', 1, '7', 50, 1, 1, 1);
