(1843, '1345679434285', '2017-10-05 18:22:57', '2017-10-11 16:56:00', '0000-00-00', '0000-00-00 00:00:00', 99706, 603560, 'ROXANA', 'CANELA', 'HERNAN CORTES', 'PENDIENTE', '', '1345679434285', NULL, 'SCL/BOG/AUA/BOG/SCL', 'CLP', 1304277.00, 46852.00, 0.00, '1.Condiciones especiales en cambios y reembolsos \nPara viajeros reservados y con tiquete confirmado entre el 20 de septiembre al 22 octubre 2017 que se vean afectados por el cese ilegal de actividades. \n \n3. Reembolso y qué condiciones para tiquetes emitidos por agencias de viajes:\nLos reembolsos deberán ser tramitados por las agencias, siempre y cuando tengan placa de AV (134), T0 (530), TA (202), LR (133) o 2K (547). Debe tenerse en cuenta que la aerolínea NO tramitará ningún reembolso de tiquetes emitidos en Agencias de Viaje. \n \n4. Como tramitar el reembolso de tiquetes emitidos en Agencias de Viaje \nLa aerolínea NO tramitará reembolsos de tiquetes adquiridos a través de Agencias de Viaje, por tanto, el pasajero deberá tramitar el reembolso en la agencia donde adquirió su tiquete, siempre respetando la forma de pago original del tiquete, si el pago fue en efectivo la agencia deberá hacer el reembolso de inmediato. \nLa agencia debe omitir las restricciones de la tarifa en cuanto a penalidades o no reembolsabilidad. No se generarán ADMs dado que este es un procedimiento autorizado por Avianca para aplicar sobre los tiquetes que estén en las fechas mencionadas en el numeral 1 de este comunicado. \n Excepcionalmente y solo para estos boletos, las agencias de Colombia, Aruba, Curazao, Ecuador y Chile podrán realizar el reembolso en efectivo de tiquetes pagados con tarjeta de crédito, los cuales serán reconocidos a la agencia de viajes mediante un ACM en el siguiente reporte de ventas de BSP. Esto aplica también para los tiquetes emitidos por agencias de viajes en Brasil y pagados con tarjeta de crédito American Express. \n', 0, '0000-00-00 00:00:00', 'T4157', 1258003.00, '2017-11-02 16:39:00', 'T4156 NC LA', 'PAGA FACTURA DE CLIENTE', 'S/N', NULL, 125800.00, '', NULL, NULL, 'SIN MULTA POR CONTINGENCIA HUELGA PILOTOS', '', 1, '7', 69, 6, 1, 2),
(1844, '1345679434286', '2017-10-05 18:26:04', '2017-10-11 16:58:00', '0000-00-00', '0000-00-00 00:00:00', 99706, 603560, 'HERNAN ', 'CORTES', 'HERNAN CORTES', 'PENDIENTE', '', '1345679434286', NULL, 'SCL/BOG/AUA/BOG/SCL', 'CLP', 1304277.00, 46852.00, 0.00, '1.Condiciones especiales en cambios y reembolsos \nPara viajeros reservados y con tiquete confirmado entre el 20 de septiembre al 22 octubre 2017 que se vean afectados por el cese ilegal de actividades. \n4. Como tramitar el reembolso de tiquetes emitidos en Agencias de Viaje \nLa aerolínea NO tramitará reembolsos de tiquetes adquiridos a través de Agencias de Viaje, por tanto, el pasajero deberá tramitar el reembolso en la agencia donde adquirió su tiquete, siempre respetando la forma de pago original del tiquete, si el pago fue en efectivo la agencia deberá hacer el reembolso de inmediato. \nLa agencia debe omitir las restricciones de la tarifa en cuanto a penalidades o no reembolsabilidad. No se generarán ADMs dado que este es un procedimiento autorizado por Avianca para aplicar sobre los tiquetes que estén en las fechas mencionadas en el numeral 1 de este comunicado. \nExcepcionalmente y solo para estos boletos, las agencias de Colombia, Aruba, Curazao, Ecuador y Chile podrán realizar el reembolso en efectivo de tiquetes pagados con tarjeta de crédito, los cuales serán reconocidos a la agencia de viajes mediante un ACM en el siguiente reporte de ventas de BSP. Esto aplica también para los tiquetes emitidos por agencias de viajes en Brasil y pagados con tarjeta de crédito American Express. \n \n', 0, '0000-00-00 00:00:00', 'T4157', 1258003.00, '2017-11-02 16:40:00', 'T4156 NCLA', 'PAGA FACTURA DE CLIENTE', 'S/N', NULL, 1258003.00, '', NULL, NULL, 'DEVOLUCION SIN MULTA POR HUELGA DE PILOTOS', '', 1, '7', 69, 6, 1, 2),
